import React, { Component } from 'react';
import {useState,useEffect} from 'react';
export default function Question(){
    const [question,setQuestion]=useState([])
    useEffect(() => {
        fetch('http://localhost:5000/user')
        .then((res)=>res.json())
        .then((json)=>{
          setQuestion(json);
        })
      },[]);

    return (
        <>
        <h1>
            {Question.length>0?(

                <p>Info:{Question}</p>
            ):(
                <p>Loading.....</p>
                
            )}
        </h1>
        </>
    )

}
